import React,{Component} from 'react'
import style from 'styled-components'
class Item extends Component{
    constructor(props){
        super(props)
        this.state ={
            course_name : ''
        }
    }
    render(){
        const CardWrapper = style.div`
        overflow: hidden;
        padding: 0 0 32px;
        margin: 35px auto 0;
        width: 60%;
        height: 125px;
        box-shadow: 0 0 3px rgba(0, 0, 0, .05), 0 0px 12px rgba(0, 0, 0, .08);
        border-radius: 13px;
        `

    return(
        <div>
            <CardWrapper />
            {this.props.courses_name}
        </div>
    );
    } 

}

export default Item;
